import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';

function App() {
  const [location, setLocation] = useState('');
  const [places, setPlaces] = useState({});
  const [loading, setLoading] = useState(false);
  const [selectedCategory, setSelectedCategory] = useState('all');
  const [weather, setWeather] = useState({ temp: '', condition: '' });
  const [currentTime, setCurrentTime] = useState(new Date());

  const fetchPlaces = useCallback(async () => {
    if (!location.trim()) return;
    setLoading(true);
    try {
      const response = await axios.get(
        `http://localhost:5000/api/places?location=${encodeURIComponent(location)}`
      );
      setPlaces(response.data);
    } catch (error) {
      console.error('Error fetching places:', error);
    } finally {
      setLoading(false);
    }
  }, [location]);

  useEffect(() => {
    // Initialize with empty data
    setPlaces({});

    // Update time every minute
    const timer = setInterval(() => {
      setCurrentTime(new Date());
    }, 60000);

    return () => clearInterval(timer);
  }, []);

  const categories = ['schools', 'colleges', 'theaters', 'medical shops'];
  const categoryIcons = {
    schools: '🏫',
    colleges: '🎓',
    theaters: '🎬',
    'medical shops': '💊',
  };

  const formatTime = (date) => {
    return date.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });
  };

  const formatDate = (date) => {
    return date.toLocaleDateString('en-US', { month: 'numeric', day: 'numeric', year: 'numeric' });
  };

  return (
    <div className="min-h-screen bg-gray-50 p-4 font-sans">
      <div className="max-w-6xl mx-auto">
        {/* Header */}
        <div className="flex justify-between items-center mb-6">
          <h1 className="text-3xl font-bold text-gray-800">Local Explorer</h1>
          <div className="text-right">
            {weather.temp && (
              <p className="text-gray-600">{weather.temp} {weather.condition}</p>
            )}
            <p className="text-sm text-gray-500">
              {formatTime(currentTime)} • {formatDate(currentTime)}
            </p>
          </div>
        </div>

        {/* Search Bar */}
        <div className="flex mb-6 bg-white rounded-lg shadow p-4">
          <input
            type="text"
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            className="flex-grow px-4 py-2 border-none focus:outline-none"
            placeholder="Enter location (e.g., Rampally, Secunderabad)"
            onKeyPress={(e) => e.key === 'Enter' && fetchPlaces()}
          />
          <button
            onClick={fetchPlaces}
            className="bg-blue-600 text-white px-6 py-2 rounded-lg hover:bg-blue-700 transition"
            disabled={loading}
          >
            {loading ? 'Searching...' : 'Search'}
          </button>
        </div>

        {/* Categories */}
        <div className="flex space-x-2 mb-6 overflow-x-auto pb-2">
          <button
            onClick={() => setSelectedCategory('all')}
            className={`px-4 py-2 rounded-full whitespace-nowrap ${
              selectedCategory === 'all' ? 'bg-blue-600 text-white' : 'bg-white text-gray-700'
            }`}
          >
            All
          </button>
          {categories.map((category) => (
            <button
              key={category}
              onClick={() => setSelectedCategory(category)}
              className={`px-4 py-2 rounded-full whitespace-nowrap capitalize ${
                selectedCategory === category ? 'bg-blue-600 text-white' : 'bg-white text-gray-700'
              }`}
            >
              {categoryIcons[category]} {category}
            </button>
          ))}
        </div>

        {/* Places List */}
        {loading ? (
          <div className="flex justify-center items-center h-64">
            <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-blue-600"></div>
          </div>
        ) : (
          <div className="space-y-6">
            {Object.entries(places).length === 0 && !loading && (
              <div className="text-center py-10">
                <p className="text-gray-500">
                  {location ? 'No places found. Try another location.' : 'Enter a location to search'}
                </p>
              </div>
            )}

            {Object.entries(places)
              .filter(([category]) => selectedCategory === 'all' || selectedCategory === category)
              .map(([category, placesArray]) => (
                <div key={category}>
                  <h2 className="text-xl font-semibold mb-4 flex items-center">
                    <span className="mr-2">{categoryIcons[category]}</span>
                    {category.charAt(0).toUpperCase() + category.slice(1)}
                  </h2>
                  <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                    {placesArray.map((place) => (
                      <div key={place.place_id} className="bg-white rounded-lg shadow overflow-hidden">
                        <div className="h-48 bg-gray-200 relative">
                          <img
                            src={place.photo_url}
                            alt={place.name}
                            className="w-full h-full object-cover"
                          />
                          {place.is_fallback && (
                            <span className="absolute bottom-2 left-2 bg-black bg-opacity-50 text-white text-xs px-2 py-1 rounded">
                              Generic image
                            </span>
                          )}
                        </div>
                        <div className="p-4">
                          <h3 className="font-bold text-lg mb-1">{place.name}</h3>
                          <p className="text-gray-600 text-sm mb-2">{place.formatted_address}</p>
                          {place.rating && (
                            <div className="flex items-center">
                              <span className="text-yellow-500">⭐</span>
                              <span className="ml-1 text-sm">{place.rating}</span>
                            </div>
                          )}
                        </div>
                      </div>
                    ))}
                  </div>
                </div>
              ))}
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
